import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./App.css";
import Layout from "./components/Layout/Layout";
import PaymentComponent from "./components/Payment/payment"; // Ensure the path is correct
import BookingComponent from "./components/Booking/Booking"; // Fixed the spelling mistake from 'ooking.jsx'

function App() {
  return (
    <Router>
      <div className="App">
        <Layout />
        <Routes>
          <Route path="/" element={<BookingComponent />} /> {/* Main route for booking */}
          <Route path="/payment" element={<PaymentComponent />} /> {/* Route for payment */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
